export default function EmpAction(){

return({
    type: 'EmpAction',
    payload: [
        {
            id: 1,
            Name: 'kumar',
            email: 'kumar@gamil.com'
        },
        {
            id: 2,
            Name: 'reddy',
            email: 'reddy@gamil.com'
        },
        {
            id: 3,
            Name: 'prashanth',
            email: 'prashanth@gamil.com'
        }
    ]

})
}
